import React, { useState } from "react";
import Navbar from "./Navbar";
import {
  Box,
  ListItem,
  ListItemText,
  ListSubheader,
  ListItemButton,

  Collapse
} from "@mui/material";
import {ExpandLess} from "@mui/icons-material"

const Home = () => {
  const [open, setOpen] = useState(false);
  const handleClick = () => {
    setOpen(!open);
  };
  return (
    <div>
      <Navbar />
      <p>Welcome, user</p>
      <div className="all-papers" style={{ display: "flex" }}>
        <Box
          sx={{
            width: "100%",
            height: 400,
            maxWidth: 360,
            bgcolor: "pink",
          }}
        >
          <ListSubheader>Practice Papers</ListSubheader>
          <ListItemButton onClick={handleClick}>
            <ListItemText primary="Physics" />
            {open ? <ExpandLess /> : <ExpandMore />}
          </ListItemButton>
          <Collapse in={open}>
              <ListItemText>2017</ListItemText>
          </Collapse>
          <ListItem>
            <ListItemText primary="Physics" />
          </ListItem>
          <ListItem>
            <ListItemText secondary="2019" />
          </ListItem>
          <ListItem>
            <ListItemText secondary="2019" />
          </ListItem>
          <ListItem>
            <ListItemText component="div">first</ListItemText>
            <ListItemText component="div">second</ListItemText>
          </ListItem>
        </Box>
        <Box
          sx={{
            width: "100%",
            height: 400,
            maxWidth: 360,
            bgcolor: "pink",
          }}
        >
          <ListSubheader>Completed Papers</ListSubheader>
          <ListItem>
            <ListItemText component="div">first</ListItemText>
            <ListItemText component="div">second</ListItemText>
          </ListItem>
          <ListItem>
            <ListItemText component="div">first</ListItemText>
            <ListItemText component="div">second</ListItemText>
          </ListItem>
        </Box>
      </div>
    </div>
  );
};

export default Home;
